import React from "react";
import Banner from "../Banner/Banner";
import Categories from "./Categories";
import Grid from '@material'

const Home = () => {
  return (
    <>
      <Banner />
      <Grid>
        <Grid item lg={2} sm={3}>
        <Categories />  
        </Grid>

      </Grid>

    </>
  );
};

export default Home;
